import React  from "react";

function Table_column_child(props){
    console.log("Table_column_child")
    let obj = {display:"none"}
    let obj2 = {display : "none"}
    
    if(props.num === props.boy_p[0]){
        obj = {display:"block"}
    }else if(props.num === props.boy_s[0]){
        obj2 = {display:"block"}
    }

    return(
        <div className={`${props.table_column_children} d-flex justify-content-center align-items-center  border-dark text-center`}>
            <div style={{position:"absolute"}}> {props.num} </div>
            <div className={`rounded-circle border bg-success Boy ${obj}`}></div>
            <div className={`rounded-circle border bg-primary Boy ${obj2}`}></div>
        </div>
    )
}

export default Table_column_child;
